import {
    GET_BACKLOG,
    GET_PROJECT_TASK,
    DELETE_PROJECT_TASK
  } from "../Actions/types";

  const initialState = {
    project_tasks: [],
    project_task: {}
  };

  export default function(state = initialState, action) {
    switch (action.type) {
      case GET_BACKLOG:
        return {
          ...state,
          project_tasks: action.payload
        };


      default:
        return state;
    }
  }
